import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
  <h1>Hello World!</h1>
  <p>This template definition spans multiple lines.</p>
`,
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'myapplication';
  name:string='Nitin sharma'
  employee=['Ashish','Goyal','raghav']
  employees={
    title:"Software Engineer",
    name:'Nitish',
    salary:100000,
    src:"https://images.unsplash.com/photo-1661961111184-11317b40adb2?ixlib=rb-4.0.3&ixid=MnwxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1172&q=80"
  }
  Isdisabled=true
  myclass=['success']
  getName(data:number):string{

    if(data==1)
    {
      return "hello from method"+data;
    }
    else
    {
      return "hello from data"+data;
    }
  }
  clicksave():void{
    alert('Wrong Input')
    this.name="updated Name"
  }
  over():void{
    this.name='Ashish'
  }
  txtchange():void{
    this.name="yup"
  }
}
<h1>UTKARSH</h1>
<app-home></app-home>
<app-home></app-home>
<app-home></app-home>
<app-home></app-home>
<p>{{name}}</p>
<h1>{{getName(11)}}</h1>
<h2>{{employee[1]}}</h2>
<h2>{{employees.name}}</h2>
<img src="{{employees.src}}" width="500"><br>
<input type="button" value="save" (click)="clicksave()" (mouseover)="over()" [disabled]="Isdisabled">
<input type="text" (change)="txtchange()" [class]="myclass">
